import React from 'react'

import './css/home.css'
import './css/main.css'

var mock_art = [{title: "Nowy sprzęt", content:"właśnie kupiłem nowy sprzęt"}];

export class Home extends React.Component {
  render(){
    return(<>
            <div className="headerPane">Co nowego ?</div>
            <NewsContainer></NewsContainer>
          </>);
  }
}

export class NewsContainer extends React.Component {
  render(){
    return(<div className="newsContainer">{mock_art.map(obj => <NewsPane>object</NewsPane>)}</div>);
  }
}

export class NewsPane extends React.Component {
  render(){
    console.log()
    return(
          <>
            <div className="newsHeader">{this.props.children.title}</div>
            <div className="newsPane">{this.props.children.content}</div>
          </>);
  }
}
